import React from 'react';
import {connect} from 'react-redux';
import {fetchplan} from '../../actions/index';
class PlanShow extends React.Component{
   componentDidMount() {
       this.props.fetchplan(this.props.match.params.id)
   }
   renderDetails() {
       return (<div class="ui card">
       <div class="content">
         <div class="right floated meta">14h</div>
         <img class="ui avatar image" src="/images/avatar/large/elliot.jpg"/> Elliot
       </div>
       <div class="image">
         <img/>
       </div>
       <div class="content">
         <span class="right floated">
           <i class="heart outline like icon"></i>
           17 likes
         </span>
         <i class="comment icon"></i>
         3 comments
       </div>
       <div class="extra content">
         <div class="ui large transparent left icon input">
           <i class="heart outline icon"></i>
           <input type="text" placeholder="Add Comment..."/>
         </div>
       </div>
     </div>);
   }
    render() {
        if(!this.props.plan)
        {
            return <div>Loading</div>
        }
        const  {Age,Weight,Height,Name,Sex,Plan}  = this.props.plan;
    return (
    <div> 
        {this.renderDetails()}
    </div>);
}
}
const mapStateToProps = (state,ownProps) =>{
return {
    plan:state.plans[ownProps.match.params.id]
}
}
export default connect(mapStateToProps,{fetchplan})(PlanShow);
